import React from 'react';
import { NavLink } from 'react-router-dom';
import SearchBar from '../components/searchbar/searchbar'
import styles from './buttonStyles.module.css';

const Nav = (props) => {
    return (
      <nav className={styles.fondo}>
  
        <div className={styles.navLinks}>
        <NavLink to="/home" className={styles.linkUno}>
            Home
          </NavLink> 
          <NavLink to="/favorites" className={styles.linkDos}>
            Favorites
          </NavLink>  
          <NavLink to="/about" className={styles.linkUno}>
            About
          </NavLink>
  
         
  
  
  
  
  
        </div>
  
        <NavLink to="/detail/:id" />
  
        <SearchBar fnct={props.fnct} />
      </nav>
    );
  };
  export default Nav;
